import React from "react";
import { Image, StyleSheet } from "react-native";

export default function Logo() {
    return (
        <Image
            source={require("../src/assets/logo.png")}
            style={styles.image}
        />
    );
}

const styles = StyleSheet.create({
    image: {
        width: 110,
        height: 110,
        marginBottom: 8,
    },
});
